  case class StrategyBundle(stratString: String, idMapString: String, originMapString: String, sourceLocString: Option[String] = None)
  object StrategyBundle {
    def fromFileContents(src: String): StrategyBundle = {
      src.split('@').toList match {
        case strat :: ids :: origins :: loc :: Nil => StrategyBundle(strat, ids, origins, Some(loc))
        case strat :: ids :: origins :: Nil => StrategyBundle(strat, ids, origins)
        case lst => throw new Exception("Strategy file should have exactly 3 sections separated by @, had " + lst.length)
      }
    }
    def fromFile(filePath:String): StrategyBundle = {
      val file = io.Source.fromFile(filePath)
      val src = file.mkString
      file.close()
      fromFileContents(src)
    }
  }

